window.bookSummaryJSON = "<p><b><i>When Grace @FilthyBlueBird tweeted her dirtiest, most delicious secret desires to MovieStar @VaughnAsher she never expected a reply, let alone a face-to-face meeting and an offer of a lifetime.&nbsp;</i></b></p> <p>And when MovieStar @VaughnAsher figured out the woman vacationing at his family’s St. Thomas resort was the author of all those dirty hashtags a fan was relentlessly tweeting at him...well that was a challenge he couldn’t pass up. He was more than happy to #RockHerFilthyWorld.</p> <p><b><i>@FilthyBlueBird’s online fantasy is about to collide with her real-life reality.&nbsp;</i></b></p> <p><b><i>And it’s about to happen now.</i></b></p> <p>Tiny problem for Grace.@VaughnAsher might be hot and sexy on the outside, but his domineering, over-the-top alpha attitude is seriously ugly. Let's just call him...#NotPrinceCharming.&nbsp;</p> <p>Still, Vaughn is persistent. Grace is mysterious, and funny, and she’s got fight to her. Her rejection makes him want her more. And everyone knows that what Vaughn Asher wants, Vaughn Asher gets.</p> <p><b><i>But Grace's rejection triggers a new side to Vaughn. And when he suddenly realizes that he wants to change to make her happy, the whole world is suddenly trying to pull them apart. </i></b></p>"; 
